import '../../styles/dashboard/head_bar.css'

class head_bar extends React.Component {

    render() {
        return (
            <div className={'head_bar_main'}>
                <div>
                    <button>
                        Menu Bar
                    </button>
                </div>
                <div>
                    <h1>Platforma Edukacjyjna</h1>
                </div>

            </div>
        )
    }

}

export default head_bar;
